import {Link} from 'react-router-dom';

const Footer = () => {
    
    
    return(
        <>
            <div className='row bg-info bg-opacity-50 app-footer'>
                <div className='col-12'>
                    Copyright by ALtudo Consulting Pvt. Ltd.
                </div>
            </div>
            
        </>
    )
}

